// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./healthcareERC20.sol";
import "./healthcareERC721.sol";

contract PatientHealthRecord {
    
    enum AppointmentStatus { Requested, Granted, Completed }

    
    PatientCurrencyTokens private currencyTokens;
    TestRecordToken private testTokens;
   

    constructor(address cToken, address rToken){
        currencyTokens= PatientCurrencyTokens (cToken);
        testTokens= TestRecordToken(rToken);
       
    }

    struct Appointment {
        uint256 id;
        address patient;
        string patientName;
        address provider;
        string providerName;
        uint256 tokensPaid;
        AppointmentStatus status; // Status of the appointment
    }

    struct Patient {
        string name;
        address addressPatient;
        uint256[] appointmentHistory;
    }

    struct HealthcareProvider {
        string name;
        address addressHP;
        uint256[] appointmentHistoryForRecruiter;
    }

    Appointment[] public appointments;
    mapping(address => Patient) public patients;
    mapping(address => HealthcareProvider) public providers;
    address[] public patientList;
    address[] public providerList;
    Appointment[] public requestedAppointments;
    string[] public acceptedApp;

    

     function registerPatient(string memory _name, address addressPatient) public {
        patients[addressPatient] = Patient({
            name: _name,
            addressPatient: addressPatient,
            appointmentHistory: new uint256[](0)
        });
        currencyTokens.sendInitialToken(addressPatient, 1000);
        patientList.push(addressPatient);
    }

    function getAllPatients() public view returns (Patient[] memory) {
        Patient[] memory result = new Patient[](patientList.length);
        for (uint256 i = 0; i < patientList.length; i++) {
            result[i] = patients[patientList[i]];
        }
        return result;
    }


    function registerProvider(string memory _name, address addressHP) public {
         providers[addressHP] = HealthcareProvider({name: _name,addressHP: addressHP,appointmentHistoryForRecruiter: new uint256[](0) // Initialize an empty array
         
        });
        providerList.push(addressHP);
        currencyTokens.sendInitialToken(addressHP, 1000);
    }


    function getAllProviders() public view returns (HealthcareProvider[] memory) {
        HealthcareProvider[] memory result = new HealthcareProvider[](providerList.length);
        for (uint256 i = 0; i < providerList.length; i++) {
            result[i] = providers[providerList[i]];
        }
        return result;
    }



    event VariableValueChanged(address value);


    function createAppointment(address _provider,uint256 _tokensPaid) public payable  {
       emit VariableValueChanged(msg.sender);
        require(msg.sender == patients[msg.sender].addressPatient, "Only the patient can create an appointment");
        require(currencyTokens.balanceOf(msg.sender) >= _tokensPaid, "Insufficient balance for appointment payment");
        uint256 appointmentId = appointments.length + 1; // The new appointment's ID

        appointments.push(
            Appointment({
                id: appointmentId,
                patient: msg.sender,
                patientName : patients[msg.sender].name,
                providerName: providers[_provider].name,
                provider: _provider,
                tokensPaid: _tokensPaid,
                status: AppointmentStatus.Requested
            })
        );

        // Add the appointment ID to the patient's appointment history
        patients[msg.sender].appointmentHistory.push(appointmentId);
        
        
        // Additional logic for handling payments.
        currencyTokens.sendTokens(msg.sender, _provider, 20);
    }


    function getAllRequestedAppointments() public view returns (Appointment[] memory) {
        return appointments;
    }

    

   function getLatestRequestedAppointmentForAA(address _patientAddress) internal view returns (uint256) {
    uint256 latestAppointmentId = 0;
    for (uint256 i = 0; i < appointments.length; i++) {
        if (appointments[i].patient == _patientAddress && appointments[i].status == AppointmentStatus.Requested) {
            latestAppointmentId = i;
        }
    }
    
    return latestAppointmentId;
}

function getLatestRequestedAppointment(address _patientAddress) internal view returns (uint256) {
    uint256 latestAppointmentId = 0;
    for (uint256 i = 0; i <= appointments.length; i++) {
        if (appointments[i].patient == _patientAddress && appointments[i].status == AppointmentStatus.Granted) {
            latestAppointmentId = i;
        }
    }
    require(latestAppointmentId != 0, "No requested appointment found for the patient iyt cralks");
    return latestAppointmentId;
}


  function seeLAtestResults() public view returns (Appointment[] memory) {
        return appointments;
      
}


    function acceptAppointment(address _patientAddress) public {
        require(patients[_patientAddress].addressPatient != address(0), "Patient does not exist");
        uint256 latestRequestedAppointment = getLatestRequestedAppointmentForAA(_patientAddress);
        require(msg.sender == appointments[latestRequestedAppointment].provider, "Only the provider can accept the appointment");
        require(appointments[latestRequestedAppointment].status == AppointmentStatus.Requested, "Appointment is not requested");

        string memory patientName = patients[_patientAddress].name;

        appointments[latestRequestedAppointment].status = AppointmentStatus.Granted; // Update the status to "appointment granted"
        require(appointments[latestRequestedAppointment].status == AppointmentStatus.Granted,"Not granted, opppossssiee");
        string memory acceptedAppointment = string(abi.encodePacked(patientName, " (patient)   - Accepted"));

        acceptedApp.push(acceptedAppointment);
}



    function getAcceptedAppointments() public view returns (string[] memory) {
   
        return acceptedApp;

    }



//ERC1155 implementation
function transferPaymentAndAssets(address recipient, uint256 amount,uint256 tokenId) external {
       
        testTokens.transferTestRecord(recipient,msg.sender, tokenId);
        currencyTokens.sendTokens(msg.sender, recipient,amount);
}




function giveTestResults(address _patientAddress) public {
    require(patients[_patientAddress].addressPatient != address(0), "Patient does not exist");
    uint256 latestRequestedAppointment = getLatestRequestedAppointment(_patientAddress);
    require(msg.sender == appointments[latestRequestedAppointment].provider, "Only providers can give test results");
    require(latestRequestedAppointment != 0, "No requested appointment found for the patient");
    require(appointments[latestRequestedAppointment].status == AppointmentStatus.Granted, "Appointment is not granted");

    appointments[latestRequestedAppointment].status = AppointmentStatus.Completed; // Update the status to "appointment completed"
    uint256 tokenId=testTokens.transferOwnershipOf721(_patientAddress, "Gynac", "MRI", "1",msg.sender);
    
    testTokens.approveContract(address(this), tokenId);
    
    testTokens.transferTestRecordHealthcare(msg.sender, _patientAddress,tokenId);
}

    event AppointmentStatusChanged(uint256 indexed appointmentId, AppointmentStatus newStatus);
    function bookSecondAppointment(address _provider) public {
        require(patients[msg.sender].addressPatient != address(0), "Patient does not exist");
        require(hasBookedAppointment(msg.sender), "Patient has not booked an appointment previously");

        // Create a new appointment for the patient with status "Requested"
        appointments.push(
            Appointment({
                id: appointments.length + 1,
                patient: msg.sender,
                patientName : patients[msg.sender].name,
                providerName: providers[_provider].name,
                provider: _provider,
                tokensPaid: 0, // No initial tokens paid
                status: AppointmentStatus.Requested
            })
        );

        // Transfer ERC-1155 token that holds money (ERC-20) and test results (ERC-721) to the patient
        //uint256 tokenId = generateTokenId(msg.sender);
        // token1155.safeTransferFrom(address(this), msg.sender, tokenId, 1, "");
    }
 
    function hasBookedAppointment(address _patient) public view returns (bool) {
        for (uint256 i = 0; i < appointments.length; i++) {
            if (appointments[i].patient == _patient) {
                return true;
            }
        }
        return false;
    }

    function generateTokenId(address _patient) internal view returns (uint256) {
        // Generate a unique token ID for the patient, e.g., based on their address
        return uint256(keccak256(abi.encodePacked(_patient, block.number, block.timestamp)));
    }


   



function getRequestedAppointments() public view returns (uint256[] memory, uint256[] memory) {
    uint256[] memory requestedIds = new uint256[](appointments.length);
    uint256[] memory requestedPayments = new uint256[](appointments.length);
    uint256 count = 0;
    for (uint256 i = 0; i < appointments.length; i++) {
        if (appointments[i].status == AppointmentStatus.Requested) {
            requestedIds[count] = appointments[i].id;
            requestedPayments[count] = appointments[i].tokensPaid;
            count++;
        }
    }
    return (requestedIds, requestedPayments);
}



function getAllTestResults() public view returns (address[] memory, string[] memory, string[] memory, string[] memory) {
    address[] memory patientAddresses = new address[](appointments.length);
    string[] memory testTypes = new string[](appointments.length);
    string[] memory testNames = new string[](appointments.length);
    string[] memory testResults = new string[](appointments.length);
    uint256 count = 0;
    for (uint256 i = 0; i < appointments.length; i++) {
        if (appointments[i].status == AppointmentStatus.Completed) {
            patientAddresses[count] = appointments[i].patient;
            testTypes[count] = "Gynac"; // Replace with the actual test type
            testNames[count] = "MRI"; // Replace with the actual test name
            testResults[count] = "1"; // Replace with the actual test result
            count++;
        }
    }
    return (patientAddresses, testTypes, testNames, testResults);
}

